import React from 'react';

const Header = () => {
    return (
      <div>
        <nav className="navbar navbar-dark bg-dark">
          <div className="navbar-brand"><i className="fas fa-th-list fa-2x"></i>
          </div>
        </nav>
      </div>
    );
}

export default Header;
